import type { FsFileEntry, PromptEntry } from '../types';

// --- Mock Data ---

const MOCK_PLIB_ENTRY: PromptEntry = {
  prompt: "A beautiful landscape painting of a mountain range at sunset, epic, vibrant colors, detailed, in the style of Albert Bierstadt.",
  generationInfo: {
    aspectRatio: "16:9",
    model: "imagen-4.0-generate-001",
    timestamp: new Date().toISOString(),
    numberOfImages: 2,
  },
  images: [
    "data:image/png;base64,-y1--A1-1",
    "data:image/png;base64,-A-1",
  ],
};

const MOCK_JPG_B64 = "data:image/jpeg;base64,";
const MOCK_PNG_B64 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVR42mNkYAAAAAYAAjCB0C8AAAAASUVORK5CYII=";


const DEMO_FILE_SYSTEM: Record<string, FsFileEntry[]> = {
    '/demo': [
        { name: 'Portraits', path: '/demo/Portraits', children: [] },
        { name: 'Landscapes', path: '/demo/Landscapes', children: [] },
        { name: 'project-notes.txt', path: '/demo/project-notes.txt' },
        { name: 'README.md', path: '/demo/README.md' },
    ],
    '/demo/Portraits': [
        { name: 'portrait_01.jpg', path: '/demo/Portraits/portrait_01.jpg' },
        { name: 'portrait_02.png', path: '/demo/Portraits/portrait_02.png' },
    ],
    '/demo/Landscapes': [
        { name: 'mountain-sunset.plib', path: '/demo/Landscapes/mountain-sunset.plib' },
        { name: 'forest_stream.jpg', path: '/demo/Landscapes/forest_stream.jpg' },
    ],
};

// --- Service Functions ---

export const getDemoTree = (): FsFileEntry[] => {
    return DEMO_FILE_SYSTEM['/demo'].filter(item => !!item.children);
};

export const getDemoFolderContents = (path: string): FsFileEntry[] => {
    return DEMO_FILE_SYSTEM[path] || [];
};

export const getDemoPlibFile = (path: string): PromptEntry | null => {
    if (path === '/demo/Landscapes/mountain-sunset.plib') {
        return MOCK_PLIB_ENTRY;
    }
    return null;
};

export const getDemoImageEntry = (path: string): PromptEntry => {
    const filename = path.split(/[\\/]/).pop() || 'Image';
    const imageSrc = path.endsWith('.jpg') ? MOCK_JPG_B64 : MOCK_PNG_B64;
    return {
        prompt: `This is a demo image file: ${filename}`,
        images: [imageSrc],
        generationInfo: {
            model: 'Demo Image File',
            aspectRatio: 'N/A',
            timestamp: new Date().toISOString(),
            numberOfImages: 1,
        }
    };
};
